INSERT INTO `si_posts` VALUES("151", "1", "2020-09-17 19:36:14", "2020-09-17 17:36:14", "<div class=\"full\">[response]</div>\r\n<div class=\"form-group\">[text* nom class:form-control]<label for=\"username\">Nom</label></div>\r\n<div class=\"form-group\">[email* email class:form-control]<label for=\"email\">Email</label></div>\r\n<div class=\"form-group\">[tel*  telephone class:form-control]<label for=\"telephone\">Téléphone</label></div>\r\n<div class=\"form-group\">[select sujet class:form-control \"demo1\" \"demo2\"]<label for=\"sujet\">Sujet</label></div>\r\n[textarea* message class:form-control class:full placeholder:message]\r\n<button type=\"submit\" class=\"btn\">Nous contacter</button>\n1\nDemande de contact [_post_title]\nSeb immop <wordpress@sebImmo.localhost>\nsebastien.avenel@outlook.fr\nFrom: [nom] <[email]>\r\nA propos du bien: [_post_title], [_post_url]\r\n\r\nMessage Body:\r\n[message]\r\n\r\n-- \r\nCet email a été envoyé via le formualire de contact de Seb Immo, agence immobilière de Caen (http://localhost/seb_immo_wp)\nReply-To: [email]\n\n\n\n\nSeb Immo \"[your-subject]\"\nSeb Immo <sebastien.avenel@outlook.fr>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Seb Immo (http://localhost/seb_immo_wp)\nReply-To: sebastien.avenel@outlook.fr\n\n\n\nMerci pour votre message. Il a été envoyé.\nUne erreur s\'est produite lors de la tentative d\'envoi de votre message. Veuillez réessayer plus tard.\nOne or more fields have an error. Please check and try again.\nUn ou plusieurs champs contiennent une erreur. S\'il vous plaît, vérifiez et essayez à nouveau.\nVous devez accepter les termes et conditions avant d\'envoyer votre message.\nCe champs est requis.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.", "Contact form 1", "", "publish", "closed", "closed", "", "contact-form-1", "", "", "2020-09-17 21:19:48", "2020-09-17 19:19:48", "", "0", "http://localhost/seb_immo_wp/?post_type=wpcf7_contact_form&#038;p=151", "0", "wpcf7_contact_form", "", "0");
